import { React } from "react";
import "./styles.css";

const Header = () => {
  return (
    <div class="home-header-container">
      <div class="home-header-logo">
        <img
          class="home-header-logo-img"
          src="https://icon-library.com/images/movies-icon-png/movies-icon-png-8.jpg"
          alt=""
        />
      </div>
    </div>
  );
};

export default Header;
